import React, { Component } from 'react';
import MyMapComponent from './MyMapComponent';

const markers = [
  {title: 'Black Swan Yoga White Oak', location: {lat: 29.7818, lng: -95.3923}},
  {title: 'Black Swan Yoga Kirby', location: {lat: 29.7249, lng: -95.4190}},
  {title: 'YogaWorks Midtown', location: {lat: 29.7491, lng: -95.3730}},
  {title: 'YogaWorks Heights', location: {lat: 29.8026, lng: -95.4078}},
  {title: 'SALT Power Yoga', location: {lat: 29.7701, lng: -95.4228}},
  {title: 'BIG Power Yoga', location: {lat: 29.7607, lng: -95.3990}}
]

export default class MyMap extends Component {

  render() {
    return (
      <MyMapComponent
      markers ={markers}
      googleMapURL={`https://maps.googleapis.com/maps/api/js?key=AIzaSyA75tqds5wbERJpp7iN6X2xTr9hu3PJNCA&v=3.exp&libraries=geometry,drawing,places`}
      loadingElement={<div style={{ height: `100%` }} />}
      containerElement={<div style={{ height: `600px`, width: `600px` }} />}
      mapElement={<div style={{ height: `100%` }} />}
      />
    );
  }
}
